import React from "react";
import { Col, Container } from "react-bootstrap";

const DevicePage = () => {
	const device = {
		id: 1,
		name: "Iphone 12 pro",
		price: 25000,
		rating: 5,
		img: "https://object.pscloud.io/cms/cms/Photo/img_0_77_2624_0_1.jpg",
	};
	return (
		<Container>
			<Col md={4}></Col>
			<Col md={4}></Col>
			<Col md={4}></Col>
		</Container>
	);
};

export default DevicePage;
